import React from "react"

class TodoItem extends React.Component {
    constructor() {
        super()
        this.state = {
            count: 0
        }
        this.handleClick = this.handleClick.bind(this)
    }

    render(props) {
        return(
            <div>
                <input type="checkbox" checked={this.props.obj.completed} onClick={handleClick}/>
                {this.props.obj.name}
            </div>
        )
    }
}

export default TodoItem
